lPadding=\"0\" width=\"100%\" align=\"center\" border=\"0\">\r\n <TR>\r\n  <TD>\r\n  <TABLE cellSpacing=\"1\" cellPadding=\"5\" width=\"100%\" border=\"0\">\r\n     <td class=\"info\" colspan=\"2\" align=\"left\">\r\n<B>$lang_feedback for $lang_ticket #$_GET[id]</B>\r\n     </td>\r\n   </tr>\r\n     <tr><td class=\"back\" colspan=\"2\" align=\"left\"> We appreciate your feedback <your custom stuff here>!\r\n   </td>\r\n   </tr>\r\n   <tr>\r\n     <td class=\"back2\" width=\"27%\"> $lang_ticket $lang_satisfaction: </td>\r\n      <td class=\"back\" width=\"63%\"> $tratings</td>\r\n   </tr>\r\n   <tr>\r\n    <td class=\"back2\" width=\"27%\"> $lang_ticket $lang_feedback:\r\n    </td>\r\n    <td class=\"back\" width=\"63%\"><textarea name=\"feedback\" cols=\"50\" rows=\"4\"></textarea><input type=\"hidden\" name=\"id\" value=\"$_GET[id]\"</</td>\r\n   </tr>\r\n<tr><td class=\"back\" colspan=\"2\"><input type=\"submit\" value=\"Submit\" name=\"submit\"></td></tr>\r\n                </table>\r\n                        </td>\r\n                        </tr>\r\n                </table>\r\n</form>'),(12,'email_password','$user_info[first_name],\r\n\r\nThis email contains your new temporary password to access $helpdesk_name.\r\n\r\nThe temporary password is: $password\r\n\r\nPlease login and change your temporary password, and update the secret question\r\nand password to assist your with future password retrievals.'),(13,'mailGate_new_page','$lang_ticket $lang_created:\r\n$supporter_site_url/index.php?t=tupd&id=$ticket[id]\r\n\r\n$lang_taskcreatedby: $ticket[user]\r\n$lang_shortdesc: $ticket[short]\r\n$lang_priority: $ticket[priority]\r\n***********************************************************\r\nDescription:\r\n$ticket[description]'),(14,'mailGate_new_receipt','We have received your email submission for a new HelpDesk Task.\r\n\r\nThe task number, assigned above, will be used to track the progress of your support request. The easiest method for updating this task with new information is to simply reply to this, or any email with the words \'HelpDesk Task #\', followed by the appropriate task number in the subject. Your task will be updated automatically.\r\n\r\n\r\nThank you,\r\nThe HelpDesk Team'),(15,'mailGate_update_page','$lang_ticket $lang_updated:\r\n$supporter_site_url/index.php?t=tupd&id=$ticket[id]\r\n\r\n$lang_taskcreatedby: $ticket[user]\r\n$lang_shortdesc: $ticket[short]\r\n$lang_priority: $ticket[priority]\r\n***********************************************************\r\nDescription:\r\n$ticket[description]'),(16,'mailGate_update_receipt','We have received your latest email submission to the HelpDesk Ticket referenced above.\r\n\r\nThe information has been added to the Ticket, and sent out to the appropriate team members.\r\n\r\nThank you,\r\nThe HelpDesk Team'),(17,'mailGate_newhire_checklist','PC PREPARATION\r\n  Assign hardware\r\n  Ghost PC and initialize and name PC according to standards.\r\n  Install additional software as required by job function.\r\n  Install user into DLO backup\r\n  Install PC into trend\r\n  Apply Updates\r\n  Add PC to WSUS\r\n  Log PC info to inventory\r\n\r\nPHONE SETUP\r\n  Assign extension\r\n  Add user name to extension\r\n  Set up Vmail\r\n\r\nADDITIONAL TASKS\r\n  Email marketing with email address and phone extension info.\r\n  New Employee Welcome Letter - email to employee and employee\'s manager\r\n'),(18,'mailGate_termination_checklist','COLLECT EQUIPMENT\r\n  Laptop\r\n  Headset\r\n  Anything of value that isn\'t nailed down at the desk\r\n\r\nDISABLE ACCOUNTS\r\n  Network authentication\r\n  DB account\r\n  Set user password to generic password\r\n\r\nFORWARDING\r\n  Forward email to manager for 30 days.  Set calendar reminder to terminate.\r\n  Set call forward to manager for 30 days.  Set calendar reminder to terminate.\r\n\r\nARCHIVAL\r\n  Archive user data from user profile and home directory to ex-employee folder.\r\n  Delete homedir on users local file server\r\n  Clean up PC profile or reGhost PC.\r\n  Rename PC to be office code-phone extension.\r\n\r\nFOLLOWUP\r\n  30 days following termination: delete email forwarding\r\n  30 days following termination: delete vmail forwarding');
